import React, { useState, useEffect } from "react";
import axios from "axios";

const Todos = () => {
  const [todos, setTodos] = useState([]);

  const getTodos = () => {
    fetch("/todos")


  };

  useEffect(() => {
    getTodos();
  }, [todos]);

  return (
    <div>
      <ul>
        {todos.map((todo) => (
          <li key={todo.id}>{todo.title}</li>
        ))}
      </ul>
      {JSON.stringify(todos)}
    </div>
  );
};

export default Todos;
